                              post_list: "<p>\n  <strong>Posts</strong> will be used for display a list of post of\n  the event (also known as News Feed). Post can be either\n  <strong>tweet message</strong> or <strong>article</strong>.\n</p>\n<p>\n  You can <strong>schedule a post</strong> and choose to send\n  <strong>push notification</strong> to your attendee when new message\n  was post or new article are published.\n</p> Note that you can have\xa0<strong>only 1 Posts</strong>\xa0page.\n",
                              profile_list: "<p>\n  <strong>Profile List</strong> will be used for display list of\n  exhibitors or guests of the event. Profile contains name,\n  description, picture, contact information.\n</p>\n<p>\n  <strong>Profiles</strong> can be grouped as <strong>Profile Group</strong>.\n  For example 'Basic Session' include John, Dave, Mike and 'Advance Session'\n  include Elon, Mark, Bill which will display as separated tabs in our application.\n</p> Note that you can have\xa0<strong>multiple Profile List</strong>\xa0page.\n",
                              schedule: "<p>\n  <strong>Schedule</strong> will be used for display\n  <strong>sessions schedule of the event</strong>.\n  Each session contains start time, end time, location, description.\n</p>\n<p>\n  Session can link to specific event so user can\n  <strong>get ticket easily</strong>.<br>\n  <strong>Sessions</strong> can be grouped as\n  <strong>Session Group</strong>. For example 'Beginner Room' contains\n  basic sessions and 'Intermidiate Room' contains advanced sessions which will display as separated tabs in our application.\n</p> Note that you can have\xa0<strong>multiple Schedule</strong>\xa0page.\n",
                              tile: "<p>\n  <strong>Tile</strong> will be used for listed featured item\n  such as posts, profiles, sessions or canvases.\n</p>\n<p>\n  You can upload any image or write any message and set direction of\n  the link to featured page and it will displayed as tile item on\n  the <strong>Space</strong> application.\n  So when user click on tile item, user will be bought to the target page.\n  Usually tile page is using for <strong>Home screen</strong> to pin\n  page or interesting content.\n</p> Note that you can have <strong>multiple Tile</strong> page.\n"
